import React from 'react';

function StateTable() {
    return (

        <div className="container" style={{
                margin: "auto",
                width: "75%",
                paddingTop: "60px"
              }}>
            <div className="row">
                <div className="col-6" style={{
                    textAlign: "left",
                    padding: "8px",
                    height: "40px",
                    backgroundColor: "#3F51B5",
                    color: "#ffffff"
                }}>Processes' State</div>
                <div className="col-6" style={{
                    textAlign: "left",
                    padding: "8px",
                    height: "40px",
                    backgroundColor: "#65C982",
                    color: "#ffffff"
                }}>Queue's State</div>
                <div className="col-3" style={{
                    textAlign: "left",
                    padding: "15px",
                    paddingTop:"30px",
                    height: "140px",
                    color: "#000000",
                    border: "1px solid grey"
                }}> 
                <h6 style={{color: "#555555"}}>Active Processes</h6>
                <h2><b href="/Log" style={{
                    padding: "30px",
                    color: '#259B24'
                    }}>
                    Number
                    </b></h2>
                </div>

                <div className="col-3" style={{
                    textAlign: "left",
                    padding: "15px",
                    paddingTop:"30px",
                    height: "140px",
                    color: "#000000",
                    border: "1px solid grey"
                }}>
                <h6 style={{color: "#555555"}}>Active Processes</h6>
                <h2><b style={{
                    padding: "30px",
                    color: '#E51C23'
                    }}>
                    Number
                    </b></h2>
                </div>

                <div className="col-2">.col-3</div>
                <div className="col-2">.col-3</div>
                <div className="col-2">.col-3</div>
            </div>
        </div>

    )
}

export default StateTable;
